import React, { useState, useEffect } from "react";
import { Navigate, Link } from "react-router-dom";
import AuthService from "../services/auth.service";
import avatar from '.images/us';
import lost from './images/animal-care-2.png';
import logo from './images/logowhite.png';

const Sidebar = () => {
  const [redirect, setRedirect] = useState(null);
  const [userReady, setUserReady] = useState(false);
  const [currentUser, setCurrentUser] = useState({ username: "" });

  useEffect(() => {
    const currentUser = AuthService.getCurrentUser();

    if (!currentUser) {
      setRedirect("/home");
    }
    setCurrentUser(currentUser);
    setUserReady(true);
  }, []);

  const logOut = () => {
    AuthService.logout();
    setRedirect("/login");
  };

  if (redirect) {
    return <Navigate to={redirect} />;
  }

  return (
    <div className="d-flex ">
      <div className="container-fluid">
        <a className="navbar-brand" href="#">
          Offcanvas navbar
        </a>
        <div
          className="offcanvas offcanvas-start  show"
          id="offcanvasNavbar"
          data-bs-backdrop="false"
          aria-labelledby="offcanvasNavbarLabel"
        >
          <div className="offcanvas-body">
            <ul className="navbar-nav justify-content-end flex-grow-1 pe-3">
              <li className="nav-item">
                <Link to={"/"}>
                  <img src={logo} height={60} width={120}/>
                </Link>{" "}
              </li>
              <li className="nav-item">
                <Link to="/profile" className="nav-link active" aria-current="page">
                  <div className="center">
                    <img src={avatar} className="profile_img" />
                    <span className="pg-16">Account Details</span>
                  </div>
                </Link>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#">
                  <div className="center">
                    <svg fill="none" height="24" viewBox="0 0 20 20" width="24" xmlns="http://www.w3.org/2000/svg">
                      <path fill-rule="evenodd" clip-rule="evenodd" d="M16.8 3.96a.87.87 0 0 0-.66.12l-.01.01-3.63 2.3v6.21l3.64 2.3a.88.88 0 0 0 1.1-.12.94.94 0 0 0 .27-.66V4.88a.95.95 0 0 0-.14-.51.9.9 0 0 0-.56-.4zM11 12.54V6.46H5.48c-.82 0-1.56.34-2.1.89a3.06 3.06 0 0 0-.86 2.15c0 .84.33 1.6.87 2.15a2.92 2.92 0 0 0 2.09.88H11zm.96-7.57 3.36-2.13a2.37 2.37 0 0 1 1.82-.33 2.4 2.4 0 0 1 1.5 1.07c.24.4.37.85.37 1.3v9.25c0 .66-.26 1.27-.7 1.71a2.38 2.38 0 0 1-2.99.34l-3.37-2.14h-2.3l.19 1.04a2.43 2.43 0 0 1-.42 1.85 2.52 2.52 0 0 1-3.47.6 2.46 2.46 0 0 1-1.03-1.59l-.36-2a4.44 4.44 0 0 1-2.24-1.23 4.56 4.56 0 0 1-1.3-3.2c0-1.25.5-2.38 1.3-3.2a4.42 4.42 0 0 1 3.16-1.34h6.48zM6.1 14.03l.3 1.64a.96.96 0 0 0 .4.62 1.02 1.02 0 0 0 1.4-.24.93.93 0 0 0 .16-.71l-.23-1.31H6.1z" fill="currentColor"></path>
                    </svg>
                    <span className="pg-16">Posts</span>
                  </div>
                </a>
              </li>
              <li className="nav-item">
                {currentUser ? (
                  <div className="navbar-nav ml-auto">
                    <li className="nav-item">
                      <Link to={"/profile"} className="nav-link">
                        {currentUser.username}
                      </Link>
                    </li>
                    <li className="nav-item">
                      <button className="nav-link" onClick={logOut}>
                        LogOut
                      </button>
                    </li>
                  </div>
                ) : (
                  <div className="navbar-nav ml-auto">
                    <li className="nav-item">
                      <Link to={"/login"} className="nav-link">
                        Login
                      </Link>
                    </li>

                    <li className="nav-item">
                      <Link to={"/register"} className="nav-link">
                        Sign Up
                      </Link>
                    </li>
                  </div>
                )}
              </li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
